        //PIS
        public static double PIS_Aliquota(int Tipo_Cliente)
        {
            double aliquota = 0;


            //Simples Nacional
            if (Tipo_Cliente == 1)
            {
                aliquota = 0;
            }

            //Lucro Presumido
            else if (Tipo_Cliente == 2)
            {
                aliquota = 0.65;
            }

            //Lucro Real
            else 
            {
                aliquota = 1.65;
            }

            return aliquota;
        }

